import {
    createBrowserRouter,
} from "react-router-dom";
import App from "../App";
import User from "../pages/User";


export const router = createBrowserRouter([
    {
        path: "/",
        Component: <App />,
    },
    {
        path: "/user",
        Component: <User/>
    },
    {
        path: "/config",
        Component
    }
]);
